import React, { Component } from 'react'

export class Main extends Component {
    render() {
        return (
            <div>
                <form onSubmit={this.props.handleSubmit}>
                Expense: <input type='text' onChange={this.props.handleExpense} name='spend'></input> <button>-</button>
                    <br/>
                    Earning: <input type='text' onChange={this.props.handleEarning} name='earn'></input>
                     <button>+</button>
                </form>
                Total Earning={this.props.earning}
                <br/>
                Total Expenses={-this.props.expense}
                <br/>

            </div>
        )
    }
}

export default Main
